// src/pages/RentersInsight.js
import React from 'react';

const RentersInsight = () => {
  return (
    <div className="bg-gray-100">
      {/* Navbar */}
      <header className="bg-white p-4 shadow flex justify-between items-center">
        <div className="text-lg font-bold">Renter Insights</div>
        <div className="flex items-center space-x-6">
          <input type="text" placeholder="Search in site" className="border rounded px-4 py-2" />
          <nav className="space-x-4">
            <a href="#" className="text-gray-600 hover:text-black">Account</a>
            <a href="#" className="text-gray-600 hover:text-black">Reviews</a>
            <a href="#" className="text-gray-600 hover:text-black">Nearby Homes</a>
          </nav>
        </div>
      </header>

      {/* Hero Section */}
      <section className="bg-green-500 text-white text-center py-20">
        <h1 className="text-4xl font-bold">Discover Insights and Reviews</h1>
        <p className="mt-4 text-xl">Read what past renters have to say</p>
      </section>

      {/* Other sections remain unchanged */}
    </div>
  );
};

export default RentersInsight;
